import React from 'react';
import ReactDOM from 'react-dom';
import * as firebase from "firebase/app";
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';


// Add Firebase services 
import "firebase/auth";
import "firebase/firestore";
//import "https://www.gstatic.com/firebasejs/6.0.2/firebase-app.js";
//import "https://www.gstatic.com/firebasejs/6.0.2/firebase-firestore.js";

var firebaseConfig = {
    apiKey: "AIzaSyBUWu46P2u56hwTx4ClhB8upvQBOdE-wWA",
    authDomain: "scheduler-188df.firebaseapp.com",
    databasei: "https://scheduler-188df.firebaseio.com",
    projectId: "scheduler-188df",
    storageBucket: "scheduler-188df.appspot.com",
    messagingSenderId: "1042925041868",
    appId: "1:1042925041868:web:dc80c0076e941eeb"
};

// Initialize Firebase
var database = firebase.initializeApp(firebaseConfig);

//var db = firebase.firestore();
module.exports.database = database.database();

ReactDOM.render(<App />, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
